import React from 'react';
import { useParams } from "react-router-dom";

function PokemonInfo() {
    
    const { pokemon } = useParams();

    return (
        <>
            <img src={pokemon.image} alt="pokemon-image" class="h-[100%]"/>
		</>
    );
}

export default PokemonInfo;
